import React from "react";
import { Link } from "react-router-dom ";

import "./navbar";

const Navbar = () => (
  <div className='header'>
    <div className='logo-container'>
      <Link to='/' className='logo'>

      </Link>
    </div>
    <div className='links'>
        <Link to='/shop'></Link>
        <Link to='/contact'></Link>
    </div>
  </div>
);

export default Navbar;
